★キーンのキッズブーツ！<br>
<br>
●スエード調素材のロングブーツ。<br>
●脱ぎ履きしやすい内側サイドファスナー付き。<br>
●花の刺繍とイミテーションベルトがアクセント。<br>
●コーディネートしやすいデザインが魅力。<br>
●冬のタウンユースなどにオススメの一足です。<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
